import React, { Component } from "react";
import { thisExpression } from "@babel/types";


class Button extends Component {

    tick() {
        this.setState({
          title: "marius"
        });
      }

    render() {
        return(
            <button href={this.props.link}>{thisExpression.state.props.title}</button>
        );
    }

}

export default Button;
